import React from 'react';

import './EmployeeBirthday.css';



const EmployeeBirthday = ({firstName, lastName, birthday}) => {
    const date = new Date(birthday);
    console.log(date.toLocaleString('ru', { month: 'eng' }))
    return (
        <>
            <h3 className='EmployeeBirthday__title'>{firstName}</h3>
            <span className='EmployeeBirthday-date'>456</span>
        </>
    )
}

export default EmployeeBirthday;
